import {MdDeleteForever} from 'react-icons/md';

const Note =({id,text,data,handleDeleteNote})=> {
    return (
        <div className="note">
            <span>{text}</span>
            <div className="note-footer">
                <small>{data}</small>
                <MdDeleteForever  className='delete-icon'size='1.3em'/>
            </div>
        </div>
    )
}

export default Note;
